DROP TABLE IF EXISTS `ser_schedule`;
CREATE TABLE `ser_schedule` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `date` date DEFAULT NULL COMMENT '出诊日期',
  `morning_begin` time DEFAULT NULL COMMENT '上午开始时间',
