  `gmt_modified` datetime DEFAULT NULL COMMENT '修改时间',
  `is_del` tinyint(4) DEFAULT NULL COMMENT '删除状态 1 已删除 0 正常',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1075663884066562050 DEFAULT CHARSET=utf8mb4 COMMENT='出诊时间表';

